import React from "react";
import Unity, { UnityContext } from "react-unity-webgl";

const unityContext = new UnityContext({
  loaderUrl: "Build/UnityLoader.js",
  dataUrl: "Build/unityBall.json",
  frameworkUrl: "Build/unityBall.wasm.framework.unityweb",
  codeUrl: "Build/unityBall.wasm.code.unityweb",
});

function spawnEnemies(amount) {
  unityContext.send("GameController", "SpawnEnemies", amount);
}

const App = () => {
  return (
    <div>
      <button onClick={() => spawnEnemies(100)}>Spawn!</button>
      <Unity unityContext={unityContext} />
    </div>
  );
};

export default App;
